import React from 'react';
import { IndexRoute, Route, hashHistory } from 'react-router';

import MyRouter from './page/myRouter';
import Home from './page/myRouter/home';
import App from './App';

export const routes = (
    <Route path="/" component={ App }>
        <IndexRoute component={ MyRouter }></IndexRoute>
    </Route>
);
